window.bookSummaryJSON = "<p>I know an Ace when I see one. And this woman, my Ace of Hearts, is the one play I can’t resist. She’s slick, counting cards and running games in my casino. But no one steals from me without consequence.</p> <p>Ace may think she’s getting away with it, but I watch her every move. I run the dark side of Vegas, and soon enough I’ll show her just how long my reach truly is. I’m not the only one who wants this sweet little con, but I’m the only one who’ll ever have her.</p> <p>My Ace of Hearts belongs only to me, whether she knows it or not.</p>"; 
